const Inmueble = ({titulo, imagenInmueble, subtitulo}) => {
    return (
        <div className='inmueble'>
        <h5> {titulo} </h5>
        <p>{subtitulo}</p>
        <img src={imagenInmueble} alt={titulo}></img>
        <br></br>
        <a href='/inmueble.slug'>Más información</a>
    </div> 
    )
}

export default Inmueble
